        Email ID: <input type="email" placeholder="Email ID" required></input> <br/>
        Department: <input list="department"></input><br/>
        Phone: <input type="tel" placeholder="Phone Number" required></input> <br/>
        DOB: <input type="date" placeholder="DOB" required></input> <br/>
            </form>
            <button>Save</button>
        </div>
        );
    }

